import React from 'react';
import { Link, Outlet } from 'react-router-dom';

export default function Layout() {
    return (
        <div>
            <h1>Welcome to the app!</h1>
            <nav>
                <Link to="Manatee">Invoices</Link> |{' '}
                <Link to="Narwhal">Dashboard</Link>
            </nav>
            <div className="content">
                <Outlet />
            </div>
        </div>
    );
}
